description:
TP Home is the communication app of Teleperformance Benelux & Suriname. TP Home offers the ability to stay informed about the company, read information about the company, view the engagement calendar and more. All in your pocket.

• News – explore the latest news about our company. With push notifications you always know what is going on;
• Information – discover who we are and what we stand for;
• Locations & contact – discover where you can find and reach us;
• Careers – All our career opportunities.

TP Home, everything connects here!
